  constructor(props) {
    super(props);

    this.componentRef = React.createRef();
  }
  render() {
    return (
      <div>
        <RefWithClassComp ref={this.componentRef} />
        <button onClick>Click to Focus</button>
      </div>
    );
  }
}

export default FoucsInput;
